  false,\n\t\"url\": null,\n\t\"notes\": \"Parker River National Wildlife Refuge is
  currently developing a habitat management plan for its management. The Refuge finalized
  a master plan in 1986; however, much of the wildlife goals and objectives from that
  planning effort are out of date. Current habitat management programs implemented
  on the Refuge includes Early Successional Habitat Management, Impoundment Management,
  Salt Marsh Restoration, and most recently, Invasive Plant Monitoring and Control.
  Management strategies are outlined for each objective.\",\n\t\"license_title\":
